window.addEventListener("load",()=>{document.getElementById("siteTitle").addEventListener("click",e=>{window.innerWidth>=768&&(e.stopPropagation(),window.location=document.getElementById("siteTitle").dataset.homepage)}),document.querySelectorAll(".nav-link").forEach(e=>{e.addEventListener("click",e=>{e.preventDefault();const t=bootstrap.Collapse.getInstance("#nav");null!=t&&t.toggle();const n=e.currentTarget.href;setTimeout(()=>{window.location=n},400)})})});